import styled from 'styled-components';

import Plus from '../../../assets/icons/plus.svg';

const StyledKeywordSearch = styled.div`
  height: 100%;
`;

const InputContainer = styled.div`
  display: flex;
`;

const TextInput = styled.input`
  padding: 7px 2px;
  border: none;
  border-bottom: 1px solid;
  &:focus {
    outline: none;
  }
`;

const Button = styled.img`
  width: 20px;
`;

const KeywordSearch = () => (
  <StyledKeywordSearch>
    <form>
      <InputContainer>
        <TextInput type="text" />
        <Button alt="add" src={Plus} />
      </InputContainer>
    </form>
  </StyledKeywordSearch>
);

export default KeywordSearch;
